import React from 'react'
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import '../CSS/weatherpanel.css'


function Weatherpanel() {
  return (
    <Container>
        <Row>
        <Col md={4}><p className='fs-3 m-5'>Location_name</p></Col>
        <Col md={{ span: 4, offset: 4 }}><p className='fs-3 m-5'>Forecast_date</p></Col>
      </Row>
      <Row className='justify-content-center align-items-center'>
      20°C
        <p className='temperature justify-content-center align-items-center'> 20°C</p>
      </Row>
    </Container>
  )
}

export default Weatherpanel;
